import React from 'react'
import Crontab from 'reactjs-crontab'
//import 'reactjs-crontab/dist/index.css'


const tasks = []

const Editor = () => {
    return (
      <Crontab 
        tasks={tasks}
        timeZone='UTC'
        dashboard={{ hidden: false }}
      />
    )
}

export default Editor
